import React from 'react';
import styled from 'styled-components';
import AdImg from '../../assets/ad.svg';

function Ad(props) {
  const aa = props.showAD;

  if (!aa) {
    return null;
  } else {
    return <ADImg />;
  }
}

const ADImg = styled.img.attrs({
  src: AdImg,
  alt: '광고이미지',
})`
  width: 100%;
  height: 80px;
`;

export default Ad;
